import logo from './resources/VAL_LOGO_STARTS.svg';
import './login.css';

function login() {
    return (
      <div className="login">
        <header className="login-header">
          <object type="image/svg+xml" data={logo} className="App-logo" alt="logo" >  
          </object>
        </header>
      </div>
    );
}

export default login;
